import React from "react";
import "./home.css";

const pallete = ["red", "orange", "black", "purple"];

const Home = () => {
    return (<>
        <section className="Home">
            <h1>Home Page!</h1>
            {
                pallete.map(value => (
                    <>
                        <div className="colour-pallete">
                            <div className="colour-stile" style={"colour='red'"}></div>
                            <div className="colour-name">{value}</div>
                        </div>
                    </>
                ))
            }
        </section>
    </>)
}

export {Home}
